  "logo_url": "https://assets.techstars.com/images/image_files/538c/eca5/ed19/4cee/2200/0005/original/codestarter-logo-tsconnect.jpg",
  "description": "Codestarter is the first nonprofit accepted into Techstars, and we are so proud to be a part of the Techstars family. \r\n\r\nAt Codestarter, we focus on getting laptops (Acer C720s running Linux) into the hands and \r\nhomes of kids who want to learn to code, but who don’t have their own hardware. To do this, we partner with organizations that teach programming, such as CoderDojo. These programs are instrumental for developing the next generation of thinkers and builders, but these classes only scratch the surface and create exposure to coding. Giving a child ownership of her own laptop emboldens her to immerse herself in learning. Plus, it’s hard to become a hacker when you only get to code for an hour once a week on a borrowed piece of equipment.\r\n\r\nOn our website (codestarter.org), we crowdfund one laptop at a time. Every time we hit $250 in donations, we will ship a Chromebook pre-loaded with Linux to a child who is waiting to enroll in a programming class. When the child receives her laptop, she’ll send you a thank-you note, and you’ll get quarterly updates on her progress for the first year as she learns to code. We want to provide complete transparency, so we’ll also give you access to our evaluation data. This way you can check in and see the long-term impact of giving laptops to kids and empowering them to code. \r\n\r\nThink back to when you got your first computer. How old were you? Did that opportunity make a difference in your life? If it did, and you or your company wants to give that same opportunity to some really great kids, join us! At Codestarter, we want to ensure that every child has the opportunity to learn how to code. And it all starts with a computer.",
