  "logo_url": "https://assets.techstars.com/images/image_files/5b5ba67fa36c11766a000229/original/icon_circle.png",
  "description": "It all started 5 years ago when cofounder Daniel was trying to access his purchasing data from Safeway. They said there was no way to access the data digitally, but if he sent them a $1 check with a handwritten letter that they would mail him a copy of his records. A couple weeks later, a stack of papers showed up and he realized that wasn’t going to work for our version of a digital pantry. \r\n\r\nIn 2017 it became evident that grocers were moving into the digital age and Daniel discovered that it is now possible to connect directly to 80+ of the largest grocers in the United States and download all of our purchases.\r\n\r\nWhen a user connects Cooklist to a store they shop at, their last few months of purchases are downloaded immediately, and then anytime they go to the store in the future those purchases are downloaded as well. Cooklist keeps track of how old everything is, and sends notifications when food is about to expire.\r\n\r\nBut what if we could invite chefs from all over the world into our kitchen and see their ideas for what meals we can cook with the food in our home?\r\n\r\nWe crawled the internet and collected 1.3 million recipes. Then we trained a series of natural language processing models to match each product in our pantry to recipe ingredients. The result is that users can open Cooklist and see thousands of recipes they can cook with the products already in their home. \r\n\r\nBut what should I buy?\r\n\r\nThe manual process of planning meals for the week, tallying up the ingredients needed to make a shopping list and going to the grocery store takes a ton of time.\r\n\r\nCooklist automates this process so users can simply choose the recipes they want to cook and Cooklist generates a shopping cart with all the products they need to buy. And since we are at the unique point in time where grocers are going digital we can pre-populate the online shopping carts at multiple grocers and make it easy to place an order for curbside pickup or delivery.\r\n\r\nCooklist launched the first beta in September of 2017 as a webapp and launched the beta iOS app in April 2018. The average user connects to 3 stores, downloads $400 worth of purchases per month and uses Cooklist 4 times per week.\r\n\r\nTo sum it up, our mission is to help people eat intelligently. Cooklist combines the intelligence of a personal chef, a personal shopper and a personal nutritionist into a service that anticipates users’ needs and helps them reach their dietary and monetary goals.",
  "brief_description": "Shows shoppers recipes they can cook with the groceries they buy, and allows them to choose recipes and automatically order the ingredients they need.",
