  "description": "EcoG is the future cloud-based platform to enable shared revenue streams and value added services in fast charging and beyond.\r\nOur asset is the combined charging system (CCS) control stack in each CCS fast charger (>22kW) combining data from the vehicle, the local user, the grid and the operator.\r\nOur solution consists of two parts: the EcoG SW stack in the chargers and the EcoG cloud platform. EcoG controls the charging process, provides connectivity and data processing. It provides value add services to stakeholders and conducts the accounting for those services. EcoG is enabling the move to shared continuous revenue streams instead of one-time sales.\r\nEcoG resolves the pain points and creates additional revenue streams for \r\nOperators, site owners, charger manufactures and chipset manufacturers.\r\nOperators and site owners create extra revenue by value add services. e.g. carbon credits: generates additional 0.4$ in 15min fast charging (resulting in 3000$ per charger and year). They gain differentiation by providing own services, e.g. customer app for local referral services and participate in the revenue stream created by the user during the charging stop, e.g. shopping mall, fitness centre etc.\r\nCharger manufacturers profit from in the cost reduction for maintenance with monitoring and predictive maintenance services as well as a reduced BOM for controller.\r\nEcoG itself benefits from revenue based on the accounting in the EcoG Cloud, energy consumption and shared revenue stream across the stakeholders (1st service: Carbon Credit accounting and payment, 2nd referral marketing and 3rd location-based advertising).\r\nThe market for electric vehicle charging is developing already today. There are more than 3,500 high power charging stations available in the US and more than 8,500 in Europe. The CCS standard has the highest growth rate in vehicles and chargers. In 2020, in the US the power revenue of EVs are estimated with 1B$ value with 6.2 M EVs on the street. And in 2030, estimations calculate 18 Mio. charging stations world-wide (DC & AC combined). Several programs and initiatives drive the growth further: (i) Electrify America alone invests 2B$ in charging infrastructure the next three years (ii) California invests 1.5 B$ for charging infrastructure in the next five years and (iii) Europe invests approx. 1.8B€ in the setup of a European charging infrastructure until 2020.\r\nEcoG is providing the platform and software stack for the future of electric mobility.",
