  "logo_url": "https://s3.amazonaws.com/companies-techstars-images/001E000000ZAYUCIA5.jpg",
  "description": "FitCause is a social fundraising platform empowering individuals to turn everyday motion into a charitable donation. We make it simple for users to fundraise for causes by leveraging fitness data from activity trackers. We also work with corporations to develop and sponsor group missions that set goals of fitness data, and link it to corporate donations. \r\n\r\nWith FitCause, everyone now has the ability to do well for themselves and do well for \r\nthe world at the same time.\r\n\r\nBusiness Model\r\nBusiness-to-business: FitCause charges brands a platform fee to create corporation missions that engage consumers in the corporate giving journey. \r\nBusiness-to-consumer: FitCause charges a transaction fee for each individual donation.\r\n\r\nMarket \r\nIndividuals are moving for causes. An estimated $4Bis raised each year from individuals participating in U.S.road races and the top 30 designated charity races. We are taking this concept and making it not only universal, but also virtual, to capture a portion of the $220B individuals donate each year. Donations to online crowd-funding platforms are growing at a 45% CAGR and FitCause is ready to capitalize on this growth. In addition, corporations donate over $15B annually. With activity trackers, brands are provided with unique data on customer insights and values. FitCause is a platform for corporations to engage consumers and spread awareness about corporate giving through social media channels. Social media spend is forecasted to grow at a 34% CAGR, exceeding $3.1B in 2014.\r\n\r\nTraction\r\nCharity Partners: FitCause is partneringwith a select group of non-profits (Make a Wish\r\nFoundation, American Heart Association, City Year, etc.) and will be expanding to others shortly.\r\nTechnology Partners: FitCause is working with Facebook to optimize sharing capabilities and is partnering on charity related open-graph visualization.\r\nUpcoming Events: Pau and Marc Gasol Family Foundation Kickoff, Challenged Athletes \r\nFoundation Boston Marathon Fundraiser, Portland Track and Field Fundraiser.\r\n\r\nFuel Integration\r\nAny individual that has a NikeFuel device (FuelBand, Nike+ Running App, Nike+ Sportswatch, etc.) will be able to create and participate in a FitCause mission. We will be expanding to include other devices and fitness applications in the future. \r\n\r\nThe FitCause Team\r\nLaura Temel and Matt Cantor have worked together on a variety of projects and initiatives since meeting in 2006 while studying at Cornell University.After graduation, Laura pursued Investment Banking for two years before beginning her first venture, PadTies, a real estate listing platform connecting college students and landlords. Matt has four years of management consulting experience where he focused on healthcare innovation and venture capital.",
