  "logo_url": "https://assets.techstars.com/images/image_files/530e/52bb/2155/f723/8500/0002/original/fitdeck.jpg",
  "description": "What is FitDeck Mobile?\r\nFitDeck Mobile is a fitness application that runs on mobile devices (including Android, BlackBerry and iPhone) and provides an effective and convenient full-body workout that can be done anywhere, anytime. It presents a unique set of exercises in a program with structure and variety that is as fun and easy to use as a deck of cards.\r\n\r\nWhat exercises are included in the FitDeck Mobile application?\r\nFitDeck Mobile’s flagship title, Bodyweight, contains 50 body-weight resistance exercises that require no weights or special equipment to perform, so they can be done in virtually any setting (office, home, gym, hotel room, park, etc.). The individual exercises are categorized by body region and have strength, flexibility, and cardio components to ensure a comprehensive, full-body workout.\r\n\r\nPilates, Office and Stairs are also currenlty available. Other FitDeck Mobile titles that are coming soon include: Navy SEAL, Dumbbell, Exercise Ball, Stretch, Combat Sports, Yoga, Resistance Tube, Kettlebell, Pull Up, Junior, Firefighter, Balance Dome, Senior, Travel, Toning Ball, Postnatal, Exercise Bar, Superman, Playground, Prenatal, Baby Stroller, TRX Suspension Trainer, Medicine Ball, Speed, Agility, Quickness, CrossTrain, Plyometrics, Speed Ladder, Vertical Jump, Core Blast, and Cones.\r\n\r\nWhat are examples of some of the exercises?\r\nFitDeck Mobile features many innovative exercises with unique body positions and movements along with surprising and interesting variations on more traditional exercises like push-ups, jumping jacks, and sit-ups. Mixed together, these exercises are remarkably effective at conditioning major muscle groups and joints from head to toe, as well as targeting those muscles you never knew you had. To learn more, download a free trial at www.fitdeckmobile.com.\r\n\r\nWhat type of person is FitDeck Mobile intended for?\r\nFitDeck Mobile provides a great workout for people of all fitness and activity levels because it offers several different intensities â€“ beginner, intermediate and advanced â€“ to suit any user’s present level and keep them challenged as they advance. Additionally, variations on certain exercises are suggested to better match each user’s ability.\r\n\r\nWhat mobile devices are currently compatible with FitDeck Mobile?\r\nFitDeck Mobile is available now for BlackBerry and Android along with an increasing majority of other cell phones and mobile devices. FitDeck Mobile for the Apple iPhone/iPod Touch is expected to be available by March 2011.\r\n\r\nHow do I know if it will work on my mobile device?\r\nPotential users can visit www.fitdeckmobile.com and use the device selection wizard to check for compatibility with FitDeck Mobile. From that point, a fully functional trial version of the product can be installed in most cases, so the user can take a test drive to see how it functions and get in a few workouts at no cost.\r\n\r\nWhere can I buy FitDeck Mobile and how much does it cost?\r\nFitDeck Mobile is available from the FitDeck Mobile website (www.fitdeckmobile.com), as well as other App Stores including: Android Market and BlackBerry App World. In any case, the one-time purchase of under $10 gives unlimited access to any available FitDeck Mobile title. That means that for less than you’d pay for a single month at a gym, you get lifelong fitness benefits that go with you anywhere your mobile device does.\r\n\r\nWhy did mobileXware develop FitDeck Mobile?\r\nThe founders of mobileXware are into health and fitness and are also accustomed to an on-the-go lifestyle. They use FitDeck Mobile regularly and wanted to share this easy and effective fitness concept with like-minded consumers. People have their mobile devices with them everywhere these days, so why not utilize that technology to ensure that fitness remains a part of their ever more hectic lives?\r\n\r\nHow does FitDeck Mobile relate to FitDeck cards and other products?\r\nThrough a growing partnership, FitDeck Mobile takes the same great content (developed by a certified personal trainer/Navy SEAL) featured in the FitDeck exercise playing cards and delivers it in a convenient digital form. Regardless of the format, the FitDeck workouts provide the ultimate combination of simplicity, effectiveness, and convenience that is unmatched by any other product.",
