  "logo_url": "https://assets.techstars.com/images/image_files/5a2edaa79c66a9453600000c/original/Official_Halo_Logo.jpg",
  "description": "Halo is a free fleet management dashboard which let's fleet operators order and pay for services such as fuel delivery, car washing, maintenance, and other conveniences in just a few clicks from an app without the need for aftermarket hardware.\r\n\r\nThe 10 million US vehicle fleet are not owned by large, central companies. 80% of fleets are small, less than 100 cars, and growing at an incredible 17% CAGR. Part of what’s driving this growth, and a shift to smaller fleets that are distributed throughout cities, is distributed car renting and car sharing companies. But the moment Zipcar solved the convenience problem by bringing cars from the airport, to parking lots near their customers 18 years ago, it created a whole new set of problems.\r\n\r\nHow do you monitor, maintain, and service this ‘distributed fleet’? To solve this, the incumbent ‘Fleet Management & Asset Tracking' companies applied the same tools that worked for semi-trucks, but it wasn’t cheap. The ‘smart fleet management’ sector now costs fleet owners $340 Bn / year. A lot of that expense comes from hardware and connectivity expenses needed to connect fleets to those antiquated, enterprise software systems. Because these incumbents started with massive fleets of vehicles, they assumed that the fleets have negotiated their own service contracts or simply employ their own service staff, so virtually none of these solutions connect to outside services.\r\n\r\n***Simply put, fleet management software is expensive, depends on hardware, and doesn’t connect to services.***\r\n\r\nHalo is free, connects to services, and requires no aftermarket hardware to operate.\r\nWe make a commission on the services delivered to our customers by our service provider partners.\r\n\r\nWe get the car location and lock/unlock access to perform this service through the same portal that the automaker's apps like Tesla, BMW ConnectedDrive, or OnStart connect through.\r\n\r\nFor service providers, they get an application that brings them free customers, directs them to the specific location of the cars they need to service, gives them temporary vehicle unlock access to do the services so there is no need to track down key, a photo inspection tool they use before and after the service, and automated receipt/invoicing once the service is done and the car is locked.",
