  "id": "hammerhead",
  "name": "Hammerhead",
  "location": {
  "street_address": "New York Plz",
  "city_name": "New York",
  "state_province_code": "NY",
  "postal_code": "10004",
  "country_code": "US"
  },
  "logo_url": "https://assets.techstars.com/images/image_files/5313/b932/c2f6/507e/7400/0006/original/hammerheadrevised-305x305.jpg",
  "description": "Hammerhead effortlessly guides you to and through great bike routes. By using intuitive light patterns to display directions and social data, we are able to dramatically cut down on the clutter of the navigation experience. And by creating cyclist-centric mapping, we are building a global network of safe bike routes with relevant, meaningful information for bikers. The future of cycling is here, and it is simply beautiful.\r\n\r\nWith Hammerhead bikers can:\r\n\r\nGet from where they are to where they need to be\r\nSimply find and follow the safest bike routes\r\nShare and discover new rides with friends and community\r\nExplore the world on their bicycle\r\nHammerhead’s founder Piet biked across the United States in 2006 as part of a trip that tragically claimed the lives of several of his Yale classmates. Several years and many miles of riding later, Piet resolved to create a good way to find safe bike routes.\r\n\r\nAfter building the initial Hammerhead prototype, Piet set about building a team equal to his vision. He began with his high school biking friend Laurence, then finishing his masters in Engineering at Brown. Piet then chanced upon Raveen at a hackathon in Pennsylvania, and tracked down Jon on a stopover from his travels in India. The new team moved into a one-bedroom apartment with a total budget of $15,000 on which to live and to build Hammerhead. They emerged 5 months later with a successful crowdfunding campaign that raised over $190 000 in pre orders from over 35 nations. This is the team that is going to change the face of navigation, starting with cycling.",
