  "description": "Totem is a community for shared, active experiences. \r\nOur mobile app enables anyone to create or discover \r\nquests that inspire offline adventures, from summiting \r\nKilimanjaro or surfing for the first time to simply finding \r\na new neighborhood walk. Totem combines media and \r\ndata from users’ mobile and self-tracking devices to tell \r\nnew, rich stories about the adventures they participate \r\nin together or from afar. We are defined by the \r\nadventures we choose and Totem is an inspirational, \r\ndiscovery tool for anyone to find their next adventure.\r\nBusiness Model\r\nTotem is positioning itself to own the network between \r\nself-tracking and mobile device users. As an initial \r\nrevenue model,Totem will partner with adventure \r\nlifestylebrands like Nike, REI, RedBull and GoPro to \r\noffer sponsored quests that connect brands to their \r\ncustomers at their peak moments. Additionally, Totem \r\nwill offer users premium features around creating \r\nprivate quests and custom merchandising options for \r\ngroup adventures.\r\nMarket\r\nTotem’s total available market is the 141 million Americans who last year took 11.5 billion \r\nadventures; a 10% increase over 2011. Annually people spend nearly double on \r\nadventure-related goods and services ($646 billion) than on motor vehicles (354 billion) \r\nor pharmaceuticals (331 billion). Totem’s initial serviceable market is the 60% of \r\nadventurers (85 million) who use the web to find information on outdoor activities. \r\n\r\nFuelBand Integration\r\nTotem is excited to be one of the first ten companies to build on the Nike+ API. We \r\ncombine users’ activity data, from apps and wearable devices like the Nike Fuelband, \r\nwith their photos, videos, and locations to tell a richer story about their adventures.\r\nThe Totem Team\r\n• Alex Howell, CEO - A lifelong entrepreneur, Alex started his first business at \r\nseventeen and for ten years worked as a freelance interactive editor managing \r\nthe production of multimedia products for clients including Gartner, SXSW and \r\nConde Nast. Alex recently completed two masters degrees in urban \r\ndevelopment and sustainable design focusing his research on entrepreneurship \r\nand urban economic development. \r\nNick Park, CTO - Nick began coding in middle school, \r\nteaching himself C++ and OpenGL before attending the \r\nUniversity of Wisconsin to study computer science. After \r\ncollege Nick worked at NVIDIA for two years, writing \r\narchitecture and hardware verification systems and leading \r\nthe Apple test suite. Nick left NVIDIA and headed to Austin to \r\ndevelop his first startup, before meeting Alex and deciding to \r\nfound Totem. \r\n• Veronica Velasquez, Creative Director - Originally from \r\nColombia, Veronica earned the Presidential Scholarship to \r\nstudy film at Pratt University. After graduating, Veronica \r\nbecame a NYC multimedia, graphic and web design swissarmy knife, notably working as a content creator at Vice \r\nMagazine and an original editor at VBS.tv. Veronica then \r\nbecame Creative Director of arena graphics and animations \r\nat Madison Square Garden for four years. She then art \r\ndirected for a number of startups before joining Nick and Alex \r\nin December 2012.",
