  "description": "Kytelabs is re-imagining the smart home by giving it a touch of humanity. While many believe the smart home is about wireless control, we know it’s much more than that. It is about the connection between a person and their home and the interactions that happen within it. Our belief is that a smart home is one that understands you and uses that information to help you live your life. The team is comprised of three highly capable computer engineers with over 5 years of experience working together. Collectively they’ve built all sorts of things from laser engraving CNC’s to umbrellas that warn you when it’s going to rain. They are best known for their BLE development board, the BLEduino, that was successfully crowd-funded on Kickstarter.\r\n\r\nThe Team\r\n\r\nJonathan –  the “designer” in the group with a specialty in UX and front-end web technologies. Prior to Kytelabs he worked at Microsoft as a Program Manager under the user experience team and has a deep passion for making hardware that is simple and easy to use. He holds a bachelor in computer engineering and a minor in economics with some training from Harvard Business School.\r\n\r\nRamon –  lives for startups and customer development. He is the mobile and back-end guy in the group. He’s always learning about the latest databases and web frameworks as well as everything Bluetooth 4.0 and iOS He has experience working at IBM and researching at MIT Lincoln Labs. He’s won several entrepreneurship awards and built one previous startup, Stography (stography.com).\r\n\r\nAngel – is passionate about embedded systems and open source hardware.. He is the hardware specialist of the group. Before Kytelabs he taught himself about electronics, worked at IBM making pretty things (front-end web development), and has been very active in the open hardware community. Extremely skilled in PCB and electronics design and can hand-solder just about anything.",
