  "logo_url": "https://assets.techstars.com/images/image_files/5772828e34b27486fc000002/original/Logo(Space)-01.png",
  "description": "MakerBloks is a Montreal-based startup that aims to empower children everywhere to become the creators, rather than just the consumers, of technology. We do this by designing innovative games that tap into children’s natural play patterns. We combine physical building blocks with a storytelling app that encourages kids to build with their hands, while learning with a story. The result is that children begin to create their own games and take ownership of the technology they’re using. Having graduated at the top of the first Canadian cohort of the Founder Institute, we see ourselves as the first step for the creative and curious minds of the next generation. \r\n \r\nThe Hardware:\r\nMakerBloks is our first product, and with it we introduce kids to the world of electricity and electronics. Colorful, interactive and magnetic building blocks allow kids as young as 6 years old to learn about circuitry in a fun and safe way. The blocks snap together flawlessly with our proprietary connectors, and are color-coded by function for easy identification. We have three themed kits: Circuitry Kit, Spy Kit and Music Kit. Every kit includes 26 blocks, and has it’s own set of special projects to build, like a lie detector test, a keyboard, or a Simon Says game.\r\n\r\nThe Software:\r\nWe have developed a story app that complements our building blocks to create a more immersive learning experience. The story challenges children to help the on-screen characters solve puzzles by using their physical MakerBloks. For example, children learn to fix lights on a car, or turn the sound down on a movie set by following the story and building real circuits with their blocks. The communication between the blocks and the story is achieved with our unique application of Bluetooth technology. With a monthly subscription, kids can receive new stories directly on their tablet - giving MakerBloks the best replay value. The app gives children access to even more educational information about the components they use,  and allows them to experiment freely with their blocks to unlock different bonuses. To make this happen, we’ve built our own license and original storylines, with a method that could be easily adapted to other popular licences through partnerships.\r\n \r\nOur goal is to create playful and fun experiences that empower kids to take ownership of the technology that surrounds them.",
