  "logo_url": "https://assets.techstars.com/images/image_files/5b7af910c1a4b815bc000001/original/NODE_LOGO_TS_Connect.png",
  "description": "Problem \r\nResidential construction is the largest US industry to have avoided technology disruption.  Homes account for 25% of carbon emissions and are full of toxic materials.  Construction labor markets are tighter than ever, resulting in a housing crisis in many cities. Boeing can assemble a 737 in 10 days, why does it take us so long to build a house?\r\n\r\nSolution \r\nNODE isn't a builder - we’re a housing systems company, and here’s what makes us different: Our purpose is to bring deeply sustainable homes to the masses.  We do this through a scalable system that slashes time and cost.  We're making this real. \r\n\r\nTechnology\r\nOur technology that unlocks the ability to scale is what we call Slide-Click-Lock (SCL). A system engineered for simplicity, and flexible enough to deliver unique designs.  It’s on-site assembly, not construction.  SCL enables massive efficiencies and solves the labor problem by unlocking a new workforce. Our vision is that just about anyone, with a bit of training,  can assemble a NODE. We're targeting 4 people, 1 month at half the cost of traditional construction.  It doesn't end there. Bringing the cost down with a highly scalable system allows NODE to be a platform for technology.  We're developing a design online platform, a distributed + shared energy model, and something we like to call Housing as a Service (HAAS). \r\n\r\nTraction  \r\nTwo projects delivered, 3 in design.  Revenue: $650K to date. 2.5M in contract for 2018.  LOI with a developer for a sustainable community outside Seattle, WA including 70-105 units, roughly 15M in revenue for 2020. Strategic Partnership for prototyping and sales with a Seattle based infill developer who completes 60-100 doors a year. \r\n\r\nBusiness Model \r\nNODE is not a builder: we are a technology platform (patent pending)  that holds the brand and customer interface, designs, IP, ensures quality, manages a supply chain and delivers a building kit, and arranges the crowdsourced labor to build. We are combining our core Slide-Click-Lock technology with several horizontal tech platforms to create a novel full stack approach for a new customer experience.",
