  "description": "We are developing a novel sensor with personalized analytics to monitor a user’s Blood Alcohol Content (BAC) by continuously detecting alcohol diffused through your skin. We intend for this technology to be integrated by other wearable manufacturers. When combined with additional user information, the data from this sensor allows us to provide estimations for the peak BAC reached, time to detox, and number of drinks consumed in a drinking session. This is actionable information for a user, enabling a previously impossible understanding one’s drinking habits, and history, and providing a valuable pivot with other health and fitness data. Ultimately, these insights help drive more informed decisions. \r\n\r\nAs a platform company, rather than directly competing in a saturated market for single function wearables, we intend to elevate the capabilities of existing wearable devices by licensing this technology. With this in mind, we have created a development platform to iterate quickly on sensor and software design. This test platform mimics a wearable in size, form, and function. The software stack consists of a phone application, cloud backend for user and sensor data, and a series of scripts which mine our backend. Hardware design is focused on the sensor housing and skin contact-points. Data integrity is ensured through thorough test procedures informed by industry veterans. To protect our developments, we are developing provisional patent applications with the help of Scott Weston of Cooley LLP",
