  "logo_url": "https://assets.techstars.com/images/image_files/59c55a309c66a9403000000d/original/0f60346.png",
  "description": "The Sprout Story\r\nAfter years of working for \r\nmultinational companies, watching \r\ntheir fellow employees work more and \r\nbecome less active, Martha Switzer \r\nand Christina Winkels realized there \r\nwas a problem. This problem went \r\nbeyond health, hitting their \r\ncompanies’ bottom lines with more \r\nsick days, lower productivity, higher \r\nemployee turnover and mounting \r\nhealth claims. They watched as their \r\nemployers poured millions into wellness \r\ninitiatives with little result. Companies had no way to manage the various programs and \r\nemployees were not participating in them. Martha and Christina saw a need for \r\nsomething scalable, sustainable and measurable. A corporate wellness platform that \r\ninspires employees to get healthy and empowers employers to manage and measure \r\ntheir biggest investment: their people. In 2012, Martha and Christina launched Sprout, \r\non it’s way to becoming the worlds leading Corporate Wellness platform.\r\n\r\nBusiness Model\r\nPricing is per employee per month, charged annually. We have clients upwards of \r\n$100,00 but expecttypical deal sizes to be anywhere between $200,00 and \r\n$1,000,000.\r\n\r\nMarket\r\n$8 billion is spent by companies on wellness initiatives globally. The market is expected \r\nto grow at 10% per year.\r\n\r\nFuel Integration\r\nSprout is integrating with Nike+ to bring the best fitness experiences to the \r\nworkplace. Nike+ FuelBand demonstrates an employee’s movement throughout the \r\nworkday and the support of colleagues in creating a culture of wellness.\r\nTraction\r\nSince being accepted into the Nike+ Accelerator powered by TechStars, Sprout has \r\nenlisted some of the most progressive companies that want to be great places to work, \r\nincluding: TD Bank, ATB Financial, The Great-West Life Assurance Company and one of \r\nthe leading global management consulting firms. Sprout has a fully functioning \r\nenterprise product, 10 full-time employees and is generating over $500K in annual \r\nrevenue.\r\n\r\nThe Sprout Team\r\nMartha Blake\r\nMartha Blake is the Co-Founder and CEO of Sprout. Martha has \r\nspent her career in various sales and marketing roles with companies \r\nsuch as Pepsi, Unilever, Nestle, and McCain, where she lead brand \r\nplanning, strategy, and execution. Martha has a degree in business \r\nfrom The University of Western Ontario. \r\nChristina Winkels\r\nChristina Winkels is the Co-Founder and COO of Sprout. Christina’s \r\ndesire for creating healthy workplaces stems from years spent as \r\ninvestment banker and competitive swimmer, where she \r\nexperienced two extremes of the health and wellness spectrum. \r\nChristina has a degree in business from the University of Western \r\nOntario.",
