  "logo_url": "https://assets.techstars.com/images/image_files/5ba1592a34a60d14bd000010/original/stockly_copia.png",
  "description": "E-retailers chase after catalogue size. Competition is about who has the larger selection of products and variations on their e-commerce website. Offering a wide range of products increases traffic and potential revenue, but it also implies more stock-outs. Today’s e-commerce suffers from a huge loss on profit due to stock-outs.\r\n\r\nStockly is a technology allowing e-retailers to increase sales, reducing stock-outs. When a product is out-of-stock on an e-retailer's website, they can keep selling it to their consumers, and it will be shipped by an other retailer of Stockly network.\r\nExample: a user wants to buy a product on e-retailer “A“ (without Stockly) but it is out of stock. He cannot buy and leaves.\r\nHowever, if e-retailer “A“ is part of Stockly network, the user won’t see that the product is out of stock, he will be able to buy it, and it will be directly shipped by an e-retailer “B“ of the network.\r\n\r\nOur approach to the stock-out problem is data-driven and mathematical. There is at this point no established solution for e-retailers targeting specifically the stock-outs problem. There are several types of companies in the competitive landscape (such as integrators, marketplace tools and drop-shipping solutions)\r\nOur solution is a network which involves high potential revenue and defensibility.",
