  "description": "Story2 is on a mission to improve students’ college and career readiness through storytelling. \r\n\r\nIn the fall of 2008, founder Carol Barash was in charge of Development and Marketing at CUNY’s tuition-free Macaulay Honors College. When the economy crashed, her students found themselves shut out of competitive jobs and internships. She had just read Daniel Pink’s book, A Whole New Mind. She worked with a professional storyteller to develop a program that taught students to tell their stories in the career process. \r\n\r\nOvernight the students’ outcomes changed! When they used personal stories to create a bridge from their past to their future, their emails got answered; they got interviews; they got jobs.\r\n\r\nCarol left CUNY and returned to her roots in EdTech. She spent two years studying the neuroscience of storytelling and testing how tools from oral storytelling could be used to improve students’ speaking, writing and collaboration. \r\n\r\nIn 2011 Story2 launched courses in NYC schools to students in the college admissions process. In 2012 Story2 codified its Moments Method(R) curriculum through a pilot course with Yale University and Bridgeport Public Schools. Students across the academic spectrum--including English Language Learners--demonstrated dramatic writing improvements working with Story2.\r\n\r\n12,000 students later, in 2014, Story2 won a spot in the Kaplan EdTech accelerator run by TechStars, hired CTO Moshiur Tarafdar--who had previously led development for Princeton Review, Unigo and 2U--and pivoted from in-person to online teaching. They’ve taught more than 25,000 students to tell their stories out loud and advocate for themselves in school, work and life. Story2 has been widely recognized for its innovative online EssayBuilder™, and was recently featured by Forbes as one of “10 EdTech Companies You Need to Know About.”",
