  "description": "Company Summary\r\nFor businesses looking to accelerate their search for the perfect coworking office, Upsuite takes the guesswork out of finding and selecting the office that is the perfect fit for their business. Unlike Googling for offices, and reviewing individual websites, Upsuite is matchmaking service for coworking that saves time and is free to use. Upsuite’s mission is to help teams do their best work. Upsuite currently operates in Denver and Toronto.\r\n\r\nManagement Team\r\nUpsuite is led by Ben Wright, a three-time founder. His previous businesses included digital marketing and SaaS offerings for the commercial real estate industry. The Upsuite team brings more than 40 years of combined experience within digital marketplaces and more than 20 years working in the coworking industry. Advisors include Dylan Taylor, COO of Colliers, David Mandell (Pivot Desk), others from Liquid Space, Reonomy, JLL, and Vend. \r\n\r\nCustomer Problem\r\nCoworking operators report that finding and qualifying new teams is the largest challenge they are facing. This is driven by their 40% average vacancy. \r\nCorporate teams are presented with hundreds of options for coworking in at least 20 North American markets today. With an average length of stay of 18 months, 2/3 of teams start looking for new options each year, often resorting to Google searches or individual operator websites.\r\n\r\nProducts & Services\r\nThe Upsuite marketplace connects thousands of coworking operators to the hundreds of thousands of corporate teams who like the flexible leases and employee friendly environments that coworking provides. Using Upsuite, operators receive a steady stream of teams walking into their facility, who are ready to buy. Upsuite is the easiest way for corporate teams to select coworking spaces in their market.\r\n\r\nTarget Market\r\nCorporate teams of 2-20. Corporate teams will spend $100 billion on coworking by 2030, according to JLL. Coworking, defined by shorter term leases, has become a $14 billion industry, with revenue coming from solopreneurs, startups, and corporate teams. According to JLL, coworking will be 30 % of corporate office portfolios by 2030 - making corporate teams the fastest growing segment of the market going forward.\r\n\r\nBusiness Model\r\nThe Upsuite business model is scalable, profitable for Upsuite and our operators. One signed lease generates $24,000 in revenue for our operator partners.",
