  "description": "In technical terms, Voxon’s technology is a volumetric display. At its core is an ultra high-speed digital light engine and a highly optimized volume rendering engine. This unique combination of hardware and software is capable of projecting over half a billion points of light every second into physical volumetric space.\r\n\r\nGeometry that is being rendered is sliced up into hundreds of digital horizontal cross sections before being projected synchronously onto a specially designed high speed reciprocating screen. As the photons of light hit the screen, they are diffused and reform a physical cross sectional image at precisely the right place in physical space. Through persistence of vision, the human eye blends hundreds of layers together, and the result is a true three-dimensional (3D) volumetric holographic representation of data that can be viewed in the same way as one would view a real object, from any angle, and without special effects, goggles or glasses.",
