  "description": "WebCurfew is the first cloud offering that provides a solution to modern parents’ biggest problem, how to set reasonable boundaries on their children’s home internet access. \r\n\r\nClassical approaches to internet parental control solutions have required parents to be an IT pro to download, install, configure and manage software that is installed on the device to be controlled.  However, in today’s modern internet home kids are accessing the internet from a litany of devices from within the home (PCs, phones, mp3 players, tablets, game consoles, …).  As a result parents are struggling to keep up.  Clearly, a device-centric, software-based parental control solution is no longer practical. \r\n\r\nWebCurfew's approach is 100% cloud-based, talking directly to the routers people already have in their home.   WebCurfew “programs” these routers to turn off access to any internet enabled device that connects to it. Our platform for remote controlling consumer routers allows us to create a single intuitive \"Control Panel\" abstraction on a web page/mobile phone for displaying all of the internet enabled devices in the home.  Parents can then turn off/on the internet access for each device, in real-time at a click of a button. It’s like having a separate \"light switch\" for all your kids internet devices. \r\n\r\nWebCurfew is the world’s first global consumer-oriented home automation application. However, rather than controlling small appliances and living room lights, WebCurfew users are controlling the internet access to their children's devices.  Today WebCurfew supports over 100 consumer-based routers with more being added every week.",
